create table player_club_team
(
    player_id      integer not null
        constraint player_club_team_player_id_fk
            references player,
    club_id        varchar not null
        constraint player_club_team_club_null_fk
            references club,
    club_team_name varchar,
    start_year     integer,
    end_year       integer default 9999,
    shirt_number   integer,
    position       integer
);

alter table player_club_team
    owner to postgres;

create index player_club_team_end_year_idx
    on player_club_team (end_year);

create index player_club_team_player_id_idx
    on player_club_team (player_id);

create index player_club_team_position_idx
    on player_club_team (position);

create index player_club_team_shirt_number_idx
    on player_club_team (shirt_number);

create index player_club_team_start_year_idx
    on player_club_team (start_year);

grant select on player_club_team to inode_readonly;

